(114, 73, 'Slide1', '', '<div class="yjsg-row">\r\n  <div class="yjsg-col-1-2">\r\n    <h4>The Spanish Chair<span>Borge Mogensen</span></h4>\r\n    <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.<br/>Suspendisse at nisl vitae tellus faucibus sagittis ut vitae<br/>nunc praesent ultricies efficitur lectus...</p>\r\n    <a href="#" class="button-color">Shop now</a> </div>\r\n  <div class="yjsg-col-1-2"> <span class="slide-price">$3.770</span> <img src="images/stories/slide1.png" alt="slide1"/> </div>\r\n</div>\r\n', 1, 'top1', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{"prepare_content":"0","backgroundimage":"","layout":"_:default","moduleclass_sfx":"bslides","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0","module_subtitle":"","module_float":"none","module_floatwidth":"","module_icon_prefix":"","module_icon_suffix":"","before_module":"","after_module":"","yjsg_module_style":"default"}', 0, '*'),
